pragma solidity >=0.4.22 <0.6.0;

contract VoteContract {

    struct Voter {
        uint weight;
        bool voted;
        uint8 vote;
        address delegate;
        bool canVote;
    }

    struct Proposal {
        uint voteCount;
    }

    modifier onlyOwner() {
        require(msg.sender == _owner);
        _;
    }

    modifier hasNotVotedYet(address voter) {
        if (voters[voter].voted) return;
        _;
    }

    modifier mayVote(address voter) {
        if (voters[voter].voted || !voters[voter].canVote) return;
        _;
    }

    modifier isPossibleProposal(uint8 proposalId) {
        if (proposalId >= proposals.length) return;
        _;
    }

    address _owner;
    mapping(address => Voter) voters;
    Proposal[] proposals;

    // Create a new ballot with $(_numProposals) different proposals.
    constructor(uint8 _numProposals) public {
        _owner = msg.sender;
        voters[_owner].weight = 1;
        voters[_owner].canVote = true;
        proposals.length = _numProposals;
    }

    // Give $(toVoter) the right to vote on this ballot.
    // May only be called by $(owner).
    function giveRightToVote(address toVoter) public onlyOwner hasNotVotedYet(toVoter) {
        voters[toVoter].weight = 1;
        voters[toVoter].canVote = true;
    }

    /// Delegate your vote to the voter $(to).
    function delegate(address to) public {
        Voter storage sender = voters[msg.sender];
        // assigns reference
        if (sender.voted || sender.canVote == false) return;
        while (voters[to].delegate != address(0) && voters[to].delegate != msg.sender)
            to = voters[to].delegate;
        if (to == msg.sender || voters[to].canVote == false) return;
        sender.voted = true;
        sender.delegate = to;
        Voter storage delegateTo = voters[to];
        if (delegateTo.voted)
            proposals[delegateTo.vote].voteCount += sender.weight;
        else
            delegateTo.weight += sender.weight;
    }

    // Give a single vote to proposal $(toProposal).
    function vote(uint8 toProposal) public mayVote(msg.sender) isPossibleProposal(toProposal) {
        Voter storage sender = voters[msg.sender];
        sender.voted = true;
        sender.vote = toProposal;
        proposals[toProposal].voteCount += sender.weight;
    }

    // Retrieve data for one proposal $(proposalId)
    function getProposalData(uint8 proposalId) public view isPossibleProposal(proposalId) returns (uint8 id, uint voteCount) {
        id = proposalId;
        voteCount = proposals[proposalId].voteCount;
    }

    function winningProposal() public view returns (uint8 winningProposalId, uint winningProposalVoteCount) {
        uint256 winningVoteCount = 0;
        for (uint8 prop = 0; prop < proposals.length; prop++) {
            if (proposals[prop].voteCount > winningVoteCount) {
                winningVoteCount = proposals[prop].voteCount;
                winningProposalId = prop;
                winningProposalVoteCount = winningVoteCount;
            }
        }
    }
}
